"""Scan a directory for stubs in Python and C# files."""
    all_stubs = []

    for root, _, files in os.walk(directory):
        for file in files:
            filepath = os.path.join(root, file)

            # Skip files we should ignore
            if should_skip_file(filepath):
                if verbose:
                    print(f"Skipping: {filepath}")
                continue

            if scan_py and is_python_file(file):
                if verbose:
                    print(f"Scanning Python file: {filepath}")
                stubs = scan_python_file(filepath)
                all_stubs.extend(stubs)
                if verbose and stubs:
                    print(f"  Found {len(stubs)} stubs")

            elif scan_cs and is_cs_file(file):
                if verbose:
                    print(f"Scanning C# file: {filepath}")
                stubs = scan_cs_file(filepath)
                all_stubs.extend(stubs)
                if verbose and stubs:
                    print(f"  Found {len(stubs)} stubs")

    return all_stubs

# Load documentation references if provided
    doc_references = set()
    if documentation_paths:
        for doc_path in documentation_paths:
            try:
                with open(doc_path, 'r', encoding='utf-8') as f:
                    content = f.read()
                    # Extract function and class names mentioned in docs
                    function_matches = re.findall(r'`([a-zA-Z0-9_]+)`', content)
                    doc_references.update(function_matches)

                    # Extract more complex references
                    complex_matches = re.findall(r'([a-zA-Z0-9_]+\.[a-zA-Z0-9_]+)', content)
                    doc_references.update(complex_matches)
            except Exception as e:
                print(f"Error reading documentation file {doc_path}: {e}")

    for stub in stubs:
        # Extract function name without class/module prefix
        base_name = stub.function_name.split('.')[-1]

        # Check if mentioned in documentation
        doc_mentioned = base_name in doc_references or any(
            ref in stub.function_name for ref in doc_references
        )

        # Categorize based on stub type and documentation mentions
        if doc_mentioned or "NotImplemented" in stub.stub_type:
            stub.category = "A"  # Critical - mentioned in docs or explicit NotImplementedError
            if doc_mentioned:
                stub.documentation_references = "Mentioned in documentation"
        elif stub.stub_type in ["TODO", "FIXME", "TODOComment"]:
            stub.category = "B"  # Important TODO items
        else:
            stub.category = "C"  # Less critical stubs

    return stubs

def __init__(self, verbose: bool = False):
        self.verbose = verbose
        self.quality_metrics = CodeQualityMetrics()
        self.stubs = []
        self.directory_results = {}

if not self.directory_results:
            raise ValueError("No analysis results available. Run analyze_directory() first.")

        # Create combined results
        combined_results = {
            'scan_date': datetime.now().strftime('%Y-%m-%d %H:%M:%S'),
            'directories_analyzed': len(self.directory_results),
            'files_analyzed': sum(r.get('files_analyzed', 0) for r in self.directory_results.values()),
            'stub_count': len(self.stubs),
            'directory_results': self.directory_results
        }

        # Calculate overall scores (weighted by files analyzed)
        total_files = combined_results['files_analyzed']
        combined_health_score = 0.0
        code_quality_score = 0.0

        if total_files > 0:
            for directory, result in self.directory_results.items():
                weight = result.get('files_analyzed', 0) / total_files
                combined_health_score += result.get('combined_health_score', 0) * weight
                code_quality_score += result.get('code_quality_score', 0) * weight

        combined_results['combined_health_score'] = round(combined_health_score, 2)
        combined_results['code_quality_score'] = round(code_quality_score, 2)

        # Generate report in specified format
        if format == 'json':
            return self._generate_json_report(combined_results, filename)
        elif format == 'csv':
            return self._generate_csv_report(combined_results, filename)
        elif format == 'text':
            return self._generate_text_report(combined_results, filename)
        elif format == 'html':
            return self._generate_html_report(combined_results, filename)
        else:
            raise ValueError(f"Unsupported report format: {format}")

"""Group endpoints that are likely similar (same resource, different methods)."""
        # Group by route pattern (replacing parameter names with placeholders)
        route_patterns = {}

        for endpoint in self.endpoints:
            # Normalize route to a pattern
            pattern = self._normalize_route(endpoint.route)
            if pattern not in route_patterns:
                route_patterns[pattern] = []
            route_patterns[pattern].append(endpoint)

        return [endpoints for pattern, endpoints in route_patterns.items() if len(endpoints) > 1]

